INSERT INTO `carbon_card` VALUES (27, 5, '可持续华尔兹', '环保与艺术的完美融合，展现环境保护的优雅与坚守', 'https://blog-1304715799.cos.ap-nanjing.myqcloud.com/imgs/11281692183869635.png', '绿色环保', 5000);
INSERT INTO `carbon_card` VALUES (28, 3, '可持续之星', '激励环保行动，引领可持续发展，为世界注入希望与灵感。', 'https://blog-1304715799.cos.ap-nanjing.myqcloud.com/imgs/10201692184475101.png', '工业小清新', 300);
INSERT INTO `carbon_card` VALUES (29, 3, '生态守护者', '致力于保护和修复生态系统，推动可持续的环境保护行动。', 'https://blog-1304715799.cos.ap-nanjing.myqcloud.com/imgs/25791692184576344.png', '绿色环保', 50);
INSERT INTO `carbon_card` VALUES (30, 5, '可持续领航者', '引领并推动社会、经济、环境可持续发展的具有远见和领导能力。', 'https://blog-1304715799.cos.ap-nanjing.myqcloud.com/imgs/39301692184650738.png', '绿色环保', 500);
INSERT INTO `carbon_card` VALUES (31, 5, '最佳生态奖章', '在生态保护和可持续发展领域做出杰出贡献。', 'https://blog-1304715799.cos.ap-nanjing.myqcloud.com/imgs/20371692184736261.png', '绿色环保', 5000);
INSERT INTO `carbon_card` VALUES (32, 5, '生态领袖者', '生态保护方面展现出领导力和卓越影响力的人士。', 'https://blog-1304715799.cos.ap-nanjing.myqcloud.com/imgs/78031692184859459.png', '绿色环保', 3500);
INSERT INTO `carbon_card` VALUES (33, 5, '低碳使者', '推动低碳生活和减少碳排放的倡导者，以身作则引领他人关注环保。', 'https://blog-1304715799.cos.ap-nanjing.myqcloud.com/imgs/10691692184952833.png', '绿色环保', 2500);
