INSERT INTO `carbon_industry` VALUES (1, 'IT/互联网行业', '包括软件开发、互联网服务、电子商务等，以信息技术为核心，促进信息传递和数字化发展。');
INSERT INTO `carbon_industry` VALUES (3, '金融服务行业', '涵盖银行、证券、保险、投资等，提供金融产品和服务，促进经济运行和资金流动。');
INSERT INTO `carbon_industry` VALUES (4, '其他行业', '不限于该分类的行业');
INSERT INTO `carbon_industry` VALUES (5, '教育行业', '包括学前教育、中小学教育、高等教育等，培养和传授知识、技能以及思维能力。');
INSERT INTO `carbon_industry` VALUES (6, '医疗健康行业', '涵盖医疗服务、药品研发制造、医疗设备等，关注人们的健康保健和医疗需求。');
INSERT INTO `carbon_industry` VALUES (7, '制造业', '包括汽车制造、电子设备制造、纺织制造等，生产和加工各类产品。');
INSERT INTO `carbon_industry` VALUES (8, '零售业', '包括零售商店、超市、电商平台等，销售各种商品给最终消费者。');
INSERT INTO `carbon_industry` VALUES (9, '媒体与娱乐行业', '涵盖电视、电影、音乐、游戏、新闻媒体等，提供信息、娱乐和文化内容。');
INSERT INTO `carbon_industry` VALUES (10, '酒店与旅游行业', '包括酒店、旅行社、旅游景区等，提供旅游和住宿服务。');
INSERT INTO `carbon_industry` VALUES (11, '建筑与房地产行业', '涵盖房屋建筑、土木工程、房地产开发等，满足人们的居住和商业需求。');
INSERT INTO `carbon_industry` VALUES (12, '农业与农产品加工行业', '包括种植业、畜牧业、食品加工等，涉及农业生产和农产品加工加工。');
