INSERT INTO `carbon_resource_type` VALUES (1, '能源相关', '能源产业', '包括燃煤、石油、天然气的燃烧等能源产生的二氧化碳排放。', '2023-07-25 15:16:11', '2023-07-25 15:16:11');
INSERT INTO `carbon_resource_type` VALUES (2, '交通运输', '运输行业', '指汽车、飞机、船舶等交通方式所产生的尾气排放、燃料消耗和能源使用。', '2023-07-25 15:16:52', '2023-07-25 15:16:52');
INSERT INTO `carbon_resource_type` VALUES (3, '农业和土地利用', '农业产业', '涵盖农业生产和土地利用方面的碳排放，如农作物种植、畜牧业等。', '2023-07-25 15:17:41', '2023-07-25 15:17:41');
INSERT INTO `carbon_resource_type` VALUES (4, '垃圾处理', '废物垃圾', '指垃圾填埋场和垃圾焚烧场等所产生的甲烷和二氧化碳等排放物。', '2023-08-16 19:39:37', '2023-08-16 19:39:37');
INSERT INTO `carbon_resource_type` VALUES (5, '建筑业', '建筑和房地产业', '涉及建筑物的建设、使用和拆除，以及与建筑相关的能源消耗和碳排放。', '2023-08-16 19:39:58', '2023-08-16 19:39:58');
INSERT INTO `carbon_resource_type` VALUES (6, '森林砍伐和林地转换', '森林和土地利用变化', '涉及森林砍伐、土地转换和森林减少等导致碳排放的活动。', '2023-08-16 19:40:17', '2023-08-16 19:40:17');
INSERT INTO `carbon_resource_type` VALUES (7, '其他行业', '其他行业', '包括餐饮、旅游、服务业等未包含在上述分类中的行业。', '2023-08-16 19:40:31', '2023-08-16 19:40:31');
INSERT INTO `emission_method` VALUES (1, '燃烧排放', '主要指能源产业中燃烧煤炭、石油和天然气等化石燃料所产生的二氧化碳排放。燃烧过程释放的碳来自于化石燃料中的碳元素。');
INSERT INTO `emission_method` VALUES (2, '工业排放', '包括工业生产过程中产生的碳排放，如钢铁、水泥、化工等行业，这些行业依赖能源消耗和化学反应来产生排放。');
INSERT INTO `emission_method` VALUES (3, '交通排放', '由汽车、飞机、船舶等交通工具燃料的燃烧引起的排放。汽车尾气中的一氧化碳、氮氧化物和挥发性有机化合物也会引起空气污染。');
INSERT INTO `emission_method` VALUES (4, '农业排放', '主要包括农作物种植和畜牧业所产生的碳排放。农业活动中使用化肥、农田灌溉、农作物腐烂等过程都可以产生二氧化碳和甲烷。');
INSERT INTO `emission_method` VALUES (5, '垃圾处理排放', '垃圾填埋场和垃圾焚烧场所产生的碳排放，包括垃圾分解所产生的甲烷和焚烧过程中释放的二氧化碳。');
INSERT INTO `emission_method` VALUES (6, '林业和土地利用变化排放', '森林砍伐和土地转换为农业用地等活动导致森林碳储存减少，从而释放大量二氧化碳到大气中。');
INSERT INTO `emission_method` VALUES (7, '建筑和房地产业排放', '建筑物在建设和使用过程中的碳排放，包括材料生产、能源消耗、室内外空调等。');
INSERT INTO `emission_method` VALUES (8, '其他排放方式', '包括餐饮业的碳排放、旅游业的航空和酒店排放、服务业的办公能源消耗等其他行业和活动导致的碳排放。');
